case class Room(name: String, sector: Int, checkSum: String, decryptedName: String)

val roomList = input.map{elem ⇒
  val pattern = "([\\w-]+)-(\\d+)\\[(\\w+)\\]".r

  elem match {
    case pattern(name, sector,checkSum) ⇒ Room(name, sector.toInt,checkSum,decryptNames(name,sector.toInt))
    case _ ⇒ Room("",0,"","")
  }
}


def sortByLength(s1: (Char,Int), s2: (Char,Int)): Boolean = {

  if(s1._2 < s2._2 ) false
  else {
    if(s1._2 == s2._2 ) {
      s1._1 < s2._1
    }
    else true
  }
}


def isCorrect(room: Room): Boolean = {
  val collection = room.name.replaceAll("-", "").groupBy(letter ⇒ letter).map(elem ⇒ elem._1 → elem._2.length).toList.sortWith(sortByLength)
  var result = true
  for {
    i ← 0 until room.checkSum.length
  } {
    if (collection(i)._1 != room.checkSum(i)) {
      result = false
      return false
    }
  }
  result
}

def decryptNames(name: String, times: Int): String = {

  def decrypt(n: String, t: Int): String = {
    if (t == 0) {
      n
    } else {
      val result = n.map {
        case 'z' ⇒ 'a'
        case '-' ⇒ ' '
        case ' ' ⇒ ' '
        case x ⇒ (x + 1).toChar
      }
      decrypt(result, t - 1)
    }
  }
  val circle = times % 26
  decrypt(name,circle)
}

val realRooms = roomList.filter(isCorrect)

val sumOfRooms = realRooms.foldLeft(0)((acc,room) ⇒ acc + room.sector )

val findNorthPole = realRooms.find(room ⇒ room.decryptedName.contains("northpole"))